script: |
  super -f text -I q11303.spq | sort > q11303.out

inputs:
  - name: q11303.spq
    data: |
      SELECT DISTINCT + ( + col0 ) AS col1, 78 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT col2 NOT BETWEEN + 7 + + 10 AND - - 37 + + 79;
  - name: tab0

outputs:
  - name: q11303.out
    data: |
      15	78
      97	78
